import { Link } from "react-router-dom";
import '../styles/navbar.css'
const NavBar = () => {
    return ( 
        <div className="navbar">
            <div className="title">
                <img src="shopping.png" alt="" />
                <h1>E-Commerce</h1>
            </div>
            <div className="links">
                <Link to="/">Home</Link>
                <Link to="/cart">Cart</Link>
            </div>
        </div>
     );
}
 
export default NavBar;
